import { Component, OnInit } from '@angular/core';
import { PersonDataService } from 'src/app/services/data-person.service';


@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent implements OnInit {

  data:any;
  age:any;
  //private birth:any;

  constructor(private dataService:DataService){}

  ngOnInit(): void {
    this.dataService.getData().subscribe({
      next: (resp) => {
        this.data = resp[0];
        console.log("Main -> Datos Personales: "+JSON.stringify(this.data));
        this.age = Math.floor(((Date.now() - Date.parse(this.data.birthdate)) / (1000 * 3600 * 24))/365);
      },
      error: (error) => {
        console.error(error);
      }
    });

  }
}
